('matteo@gmail.com', 'Toyota C-HR Hybrid, perchÃ© noleggiarlaâ€¦ invece di comprarla. Ho messo altro.', 'Lâ€™ibrido e il crossover sono due parole sempre piÃ¹ di moda, anche nel noleggio. La Toyota C-HR Ã¨ lâ€™auto che racchiude entrambi questi concetti e lo fa con uno stile originale, costi di gestione contenuti e una ricca dotazione che la rendono appetibile per i clienti flotta tradizionali (aziende e professionisti) e anche per i privati.\r\n\r\nCom\'Ã¨ accessoriata\r\nLa C-HR Ã¨ unâ€™auto di tendenza e, come si intuisce dallo stile, privilegia chi siede davanti rispetto a chi sta dietro e al bagagliaio che non Ã¨ piccolo, ma Ã¨ scomodo, cosÃ¬ come lo Ã¨ la maniglia della portiera posteriore: troppo alta per un bambino. Ben fatta allâ€™interno, la C-HR offre una posizione di guida confortevole e una strumentazione sportiva. Accanto câ€™Ã¨ lo schermo da 8 pollici che non ha Android Auto nÃ© Apple Carplay e sarebbe un poâ€™ piÃ¹ comodo se avesse qualche comando fisico in piÃ¹. Lâ€™equipaggiamento di sicurezza Ã¨ molto buono sin dalla versione dâ€™attacco Active, la Style si sceglie per lâ€™originalitÃ  mentre la Lounge comprende anche il Tech Pack che porta al massimo la dotazione per il comfort e la sicurezza ed Ã¨ ordinabile anche per la versione in prova Trend. Praticamente equivalente a questâ€™ultima Ã¨ la Business che ha perÃ² i cerchi da 17 pollici invece che da 18 per limitare i costi di gestione.\r\n\r\nCome si guida\r\nLa CH-R, come tutte le auto ibride, suggerisce uno stile di guida diverso, ma comunque appagante. Per ottenere il massimo, bisogna anticipare e addolcire le manovre. Dopo pochi chilometri, lâ€™obiettivo non Ã¨ piÃ¹ andare forte, ma recuperare quanta piÃ¹ energia e lasciare il milleotto a benzina a tacere viaggiando il piÃ¹ possibile in elettrico. Guidata cosÃ¬, la CH-R Ã¨ molto piacevole perchÃ© Ã¨ fluida e si fa anche valere in curva perchÃ© ha un assetto piatto e lo sterzo Ã¨ preciso e progressivo. In cittÃ  il silenzio Ã¨ quasi assoluto e assorbe molto bene le buche, anche se non sono ben percepibili gli ingombri e câ€™Ã¨ la retrocamera, ma non i sensori. La Toyota C-HR Ã¨ gradevole anche sulle tangenziali e in statale, meno in salita quando si affonda e il motore si sente di piÃ¹. In autostrada invece gira a regime ridotto e dopo 120 km/h Ã¨ avvertibile solo qualche fruscio.\r\n\r\nQuanto costa\r\nSe la si prende a noleggio per 2 anni, con 30.000 km e tutti i servizi compresi (immatricolazione, assicurazione, bollo, assistenza e altro ancora), lâ€™offerta di ALD per i privati parte da 355 euro con un anticipo di 3.950 euro (per richiedere un preventivo personalizzate cliccate qui). Quanto ai consumi la C-HR costa poco alla pompa. In autostrada fa 16 km/litro, sulle statali si attesta sui 21-22 e in cittÃ  oscilla tra 16-18 km/litro con il vantaggio di evitare i divieti di circolazione e poter parcheggiare sulle strisce blu. Vi ricordiamo, infine, che la C-HR Hybrid parte da 28.400 euro, la versione Trend costa 30.000 euro tondi e che, a paritÃ  di percorrenza, ha un costo chilometrico di 53 centesimi al chilometro.', '2018-02-08', 1),
('nicolacarl77@gmail.com', 'Alcol alla guida, cosa si rischia', 'Alcol e auto, una coppia molto pericolosa: l\'ulteriore conferma arriva dal piÃ¹ recente Alcohol Prevention Day. Come evidenzia la Fondazione Ania (onlus dellâ€™Associazione delle compagnie), nel mondo sono 6 milioni le persone che assumono sostanze alcoliche con modalitÃ  di consumo a rischio e non consapevoli. La Commissione Europea, per il 2012 (ultimi dati disponibili), stima in 6.500 le vittime in Europa a causa della guida in stato di ebbrezza. In Italia, lâ€™Istat, dal 2009, per via dellâ€™esiguo numero di casi documentati, ha tolto la guida in stato di ebbrezza tra le cause accertate di incidentalitÃ  stradale; solo lâ€™Istituto Superiore di SanitÃ  fornisce una stima degli incidenti alcol correlati, che si attesta al 30% del totale dei sinistri con lesioni. Inoltre, ad affiancare il consumo tradizionale dellâ€™alcol (bere giornalmente durante i pasti) si diffondono soprattutto fra i giovani attivitÃ  come il binge-drinking (bere ripetutamente in modo compulsivo fino a ubriacarsi) e lâ€™eye-balling (una pratica che prevede di versare Vodka, Rum o Assenzio negli occhi allo scopo di far entrare lâ€™alcol in circolo nel sangue in maniera piÃ¹ veloce e diretta).\r\nVediamo i rischi nel dettaglio\r\n\r\n#1. Sicurezza stradale. Per legge, il limite Ã¨ di mezzo grammo di alcol ogni litro di sangue. Fanno eccezione, fra gli altri, i soggetti con patente da meno di 3 anni: per loro (neopatentati), câ€™Ã¨ la tolleranza zero, non possono bere neppure un goccio prima di guidare. Ãˆ vero che gli effetti dellâ€™alcol dipendono dalla persona, ma, come ricorda lâ€™ACI, le prime conseguenze negative del bere si cominciano a riscontrare giÃ  con valori di 0,2 grammi di alcol per litro di sangue: puÃ² venir meno la capacitÃ  di suddividere l\'attenzione tra due o piÃ¹ fonti di informazioni. Con un tasso di 0,5 g/litro cominciano a essere compromessi il campo visivo laterale, i tempi di reazione, la resistenza all\'abbagliamento e il coordinamento psicomotorio. A quota 0,8 g/litro, sono compromesse anche la capacitÃ  di valutazione delle distanze e la sensibilitÃ  alla luce rossa: sono guai al semaforo rosso. E con un grammo di alcol per litro di sangue? Compare l\'euforia, la visione laterale va ko, come pure la percezione delle distanze e della velocitÃ  di movimento degli oggetti. A tassi oltre il grammo e mezzo, si hanno la completa sottovalutazione dei pericoli e lo scoordinamento dei movimenti (si accelera invece di frenare).\r\n\r\n#2. Sanzioni per chi sgarra. Ogni multa per chi si ubriaca e guida Ã¨ composta da piÃ¹ elementi. Semplificando, per un tasso alcolemico superiore a 0,5 e non superiore a 0,8 grammi per litro di sangue, la sanzione amministrativa Ã¨ di 532 euro, con in piÃ¹ la sospensione della patente da 3 a 6 mesi. La seconda fascia Ã¨ un tasso alcolemico superiore a 0,8 e non superiore a 1,5 grammi per litro: ammenda di 800 euro, arresto fino a 6 mesi, sospensione della patente di guida da 6 mesi a un anno. Oltre 1,5 grammi di alcol per litro di sangue: 1.500 euro, l\'arresto da 6 mesi a un anno, sospensione della patente di guida da uno a 2 anni. Con la sentenza di condanna, ovvero di applicazione della pena su richiesta delle parti, anche se Ã¨ stata applicata la sospensione condizionale della pena, Ã¨ sempre disposta la confisca del veicolo. Se questo appartiene a persona estranea al reato, la durata della sospensione della patente Ã¨ raddoppiata. E se il neopatentato sgarra? Multa di 164 euro fra 0 e 0,5 grammi di alcol per litro di sangue.\r\n\r\n#3. Rivalsa assicurativa. In premessa, va detto che per un incidente in stato normale, lâ€™assicurazione risarcisce tutti i danni causati ad auto e persone. Ma se si provoca un sinistro sotto lâ€™effetto di alcol, lâ€™impresa rimborsa tutti i danni a chi ha subÃ¬to il sinistro: dopodichÃ©, esige dalla persona ubriaca una parte di quello che ha pagato. O tutta la somma. Ãˆ la rivalsa assicurativa: in caso di lesioni gravi, lâ€™indennizzo lievita a milioni di euro.\r\n\r\nUn calcolatore indicativo\r\nSolo per dare unâ€™indicazione, il ministero della Salute mette a disposizione un calcolatore di tasso alcolemico per migliorare la sicurezza stradale. Il valore di alcolemia varia in base al sesso, al peso corporeo, all\'essere a stomaco vuoto o pieno ed alla quantitÃ  e tipologia di bevande assunte: il conteggio del sito si riferisce a un\'assunzione entro i 60-100 minuti precedenti (subito dopo l\'assunzione, si avrÃ  un certo risultato; a distanza di tre ore, un altro risultato). Inoltre, il calcolo non tiene conto dei fattori concomitanti come la stanchezza, il fumo di sigaretta, l\'interazione con i farmaci o una malattia.', '2018-02-08', 1),
('nicolacarl77@gmail.com', 'Audi Sport Performance Parts, come migliorare le TT e R8', 'Le TT e R8 saranno i primi modelli a ricevere gli accessori della linea Audi Sport Performance Parts, dotazioni ordinabili anche dopo lâ€™acquisto che migliorano la linea dellâ€™auto e il suo comportamento nella guida sportiva. Il catalogo sarÃ  ordinabile entro la fine dellâ€™estate e interessa quattro aree dellâ€™auto: il telaio, lâ€™impianto di scarico, la carrozzeria e lâ€™abitacolo. Nel primo caso i tecnici della casa tedesca hanno sviluppato nuovi sistemi di raffreddamento per i freni delle TT, TTS, TT RS e pastiglie dei freni piÃ¹ resistenti alla fatica, disponibili per i tradizionali dischi in acciaio o per quelli in materiali compositi: sulla R8, ad esempio, le nuove pastiglie sono di colore rosso fluorescente e pesano 1 chilo in meno di quelle standard. Le due coupÃ© migliorano cosÃ¬ gli spazi di frenata e sono piÃ¹ adatte per la guida in circuito, frangente in cui i freni risentono molto della fatica.\r\n\r\nCon i nuovi spoiler migliora la stabilitÃ \r\nIl listino Audi Sport Performance Parts include sospensioni regolabili, una nuova barra di irrigidimento posteriore per la TT CoupÃ© a trazione integrale e ruote da 20 pollici di colore nero, che fanno risparmiare 7,2 chili sulle TT e 8 chili sulle R8: Audi le ha costruite ispirandosi al mondo delle corse. A disposizione câ€™Ã¨ anche lâ€™impianto di scarico alleggerito della Akrapovic (i terminali sono in titanio) e tutta una serie di appendici per la carrozzeria, che migliorano lâ€™estetica ma soprattutto lâ€™aderenza delle auto alle forti velocitÃ : i baffi anteriori ai lati del fascione, le nuove minigonne, il diffusore posteriore e la grande ala aumentano la spinta a terra sulla R8 fino a 52 chili (+26 chili) a 150 km/h ed a 250 chili (+100 chili) a 330 km/h. I particolari sono costruiti in fibra di carbonio rinforzata (CFRP) sulla R8 o in CFRP e plastica sulla TT, che riceve anche un cofano anteriore con prese dâ€™aria maggiorate.\r\n\r\nSulla TT Ã¨ possibile togliere il divanetto\r\nLâ€™interno delle Audi TT e R8 si puÃ² arricchire tramite un volante rivestiti in Alcantara, palette del cambio automatico in CFRP e una barra di irrigidimento per la TT da montare al posto dei sedili posteriori, che fa risparmiare 20 chili e promette benefici a livello di rigiditÃ  torsionale: grazie ad essa la TT dovrebbe rivelarsi piÃ¹ fedele e precisa in curva. Gli accessori del catalogo Audi Sport Performance Parts verranno riservati in futuro ad altre vetture, in maniera analoga alla BMW, dove gli optional sono disponibili dalla piÃ¹ economica Serie 1 fino alla prestigiosa Serie 7. La casa dei Quattro Anelli non ha rivelato per adesso i prezzi dei singoli accessori.', '2018-02-08', 1),
('nicolacarl77@gmail.com', 'Freni auto, particolato e inquinamento, ecco una soluzione', 'Forse non tutti sanno che le polveri sottili emesse in atmosfera dalle auto non vengono tutte dall\'impianto di scarico, ma che il 32% di questo particolato Ã¨ creato da freni e pneumatici. Il dato Ã¨ chiaramente indicato da uno studio dell\'agenzia ambientale del Baden-WÃ¼rttemberg, in Germania e sta spingendo varie aziende tedesche (vedi ad esempio la speciale Passat di Mann+Hummel) a puntare su una riprogettazione di questi elementi per ridurre le polveri dei freni e migliorare la qualitÃ  dell\'aria, soprattutto in cittÃ . Fra queste c\'Ã¨ la Buderus Guss, consociata di Bosch, che ha sviluppato iDisc, un freno a disco di nuovo tipo che rispetto a un freno a tradizionale genera il 90% di polvere in meno. GiÃ  da questo mese l\'iDisc viene prodotto da Buderus Guss per una non meglio identificata Casa automobilistica.\r\n\r\nPur realizzato con la tecnologia di un tradizionale disco in ghisa, il nuovo iDisc prodotto negli stabilimenti tedeschi di Breidenbach e LudwigshÃ¼tte ha un esclusivo rivestimento in carburo di tungsteno che riduce l\'usura del disco. Questa tecnologia rende l\'iDisc Buderus Guss tre volte piÃ¹ costoso di un normale disco in ghisa e tre volte meno costoso di uno carboceramico, ma l\'azienda tedesca prevede che il prezzo si ridurrÃ  progressivamente con l\'aumento della produzione. Altri vantaggi dell\'iDisc, almeno a detta del produttore, sono la potenza di frenata simile ai freni ceramici, la riduzione dei fenomeni di \"fading\" e l\'eliminazione di ogni tipo di corrosione o ruggine. Da non sottovalutare anche il fatto che le ridotte polveri dei freni sporcano di meno i cerchi ruota e che la superficie lucida dei dischi in carburo di tungsteno resta brillante nel tempo.', '2018-02-08', 1),
('nicolacarl77@gmail.com', 'Guida autonoma, accordo tra Continental e Nvidia', 'Il gruppo Continental ha annunciato un accordo con Nvidia per la diffusione di un sistema di guida autonoma su larga scala. Lâ€™obiettivo Ã¨ quello di portare, entro il 2021, gli attuali veicoli a guida autonoma di livello 2 (per intenderci, quelli dotati, per esempio, di frenata assistita) fino al livello 5, in cui lâ€™auto guida in maniera completamente indipendente dal pilota, gestendo accelerazione, frenata e direzione.\r\n\r\nUn unico team\r\nGli ingegneri Continental e Nvidia lavoreranno in un unico team: si vuole integrare lâ€™esperienza maturata sul campo del colosso dei processori, che con il sistema Nvidia Drive Xavier ha giÃ  mosso importanti passi nel campo della guida autonoma, con lâ€™esperienza di Continental nel campo dei sensori, dai radar alle telecamere. Secondo Elmar Degenhart, CEO di Continental, \"Il veicolo del futuro sarÃ  un computer per il rilevamento, la pianificazione e l\'attuazione: la complessitÃ  della guida autonoma non richiede altro che la piena potenza computazionale di un supercomputer di intelligenza artificiale. Insieme alle prestazioni e flessibilitÃ  della soluzione di guida autonoma e alla comunicazione tra cloud e auto di Nvidia, raggiungeremo nuovi livelli di sicurezza, comfort e personalizzazione per i veicoli futuri\"\r\n\r\nTutto sotto controllo\r\nTutto punta verso il cosiddetto \"deep learning\", la raccolta dei dati derivanti non solo dallâ€™auto, ma anche dallâ€™ambiente circostante attraverso sensori dedicati. Allâ€™inizio si cercherÃ  di sviluppare le piÃ¹ avanzate funzioni di guida autonoma attuali (telecamere a 360Â° e sistemi ADAS di aiuti alla guida) integrandoli con mappe in alta definizione e sensori di controllo dei passeggeri, sulla stessa riga di quanto presentato da Honda al CES di Las Vegas.', '2018-02-08', 1),
('nicolacarl77@gmail.com', 'McLaren Senna, nuovi dettagli da brivido', 'La McLaren Senna Ã¨ lâ€™hypercar inglese da 800 CV che si Ã¨ mostrata quasi due mesi fa con le prime foto ufficiali e che farÃ  il suo debutto ufficiale al prossimo Salone di Ginevra, ma in attesa del 6 marzo Ã¨ giÃ  in grado di far sognare gli appassionati di tutto il mondo con i nuovi dettagli tecnici appena svelati. Solo per dare una manciata di dati da brividi possiamo iniziare con la velocitÃ  massima di 340 km/h, un tempo di accelerazione da 0 a 100 km/h di appena 2,8 secondi e unâ€™aerodinamica attiva con grande ala posteriore che genera un carico verticale di 800 kg a 250 km/h. Per risvegliarvi dal sogno ricordiamo che i 500 esemplari previsti sono giÃ  tutti venduti al prezzo (in Italia) di 945.500 euro, tasse incluse.\r\nPeso di 1.198 kg e aerodinamica attiva:\r\nVolutamente concepita per la pista, ma omologata stradale, la McLaren Senna che vedremo a Ginevra nellâ€™inedita livrea grigia mostrata qui sopra sfrutta il motore 4.0 V8 biturbo da 800 CV e 800 Nm, il piÃ¹ potente di sempre per la Casa di Woking. La piÃ¹ estrema delle McLaren stradali arriva a pesare solo 1.198 kg ed Ã¨ in grado di raggiungere i 200 km/h da ferma in soli 6,8 secondi. Lâ€™obiettivo degli ingegneri inglesi Ã¨ stato quello di raggiungere nuovi livelli di prestazioni, anche superiori a quelli della McLaren P1, studiando al meglio i flussi aerodinamici e di raffreddamento della meccanica per poter dare massima efficienza allâ€™ala posteriore a doppia lama in fibra di carbonio.\r\nSempre e solo fibra di carbonio:\r\nLa stessa fibra di carbonio Ã¨ il materiale base della McLaren Senna che sfrutta la monoscocca Monocage III dotata di doppia parete posteriore integrata nella struttura della gabbia protettiva. I pannelli della carrozzeria utilizzano lo stesso materiale composito e pesano appena 60 kg, con carbonio a vista esteso a cruscotto e pannelli porta nellâ€™abitacolo che utilizza anche Alcantara o pelle. La robusta struttura Monocage III permette di ridurre le dimensioni dei montanti migliorando la visibilitÃ  generale, mentre il sedile scorrevole su rotaie permette di trovare la giusta posizione di guida e ha fissato sul fianco i pulsanti di selezione del cambio automatico; la scelta delle marce Ã¨ attivabile ovviamente anche con le grandi palette poste dietro al volante e davanti alla strumentazione su schermo pieghevole TFT.\r\nSupersportiva con tutti i comfort:\r\nSulla McLaren Senna non mancano perÃ² tutti i comfort di unâ€™auto di lusso come ad esempio lo schermo centrale dellâ€™infotainment flottante (8â€) e inclinato verso il guidatore, i sensori posteriori e la retrocamera senza sovrapprezzo, i sedili Super-Lightweight da viaggio a richiesta o lâ€™impianto audio sviluppato con Bowers & Wilkins. Tornando agli aspetti piÃ¹ squisitamente tecnici troviamo lâ€™impianto di scarico in Inconel e titanio, la trazione posteriore gestita attraverso un cambio automatico doppia frizione a 7 rapporti, le sospensioni RaceActive Chassis Control II (doppio braccio oscillante con ammortizzatori adattivi interconnessi idraulicamente sulle quattro ruote) e la regolazione dellâ€™aerodinamica con il pannello Active Dynamics (Comfort, Sport e Track). Di serie sono i pneumatici Pirelli P Zero Trofeo R - 245/35 ZR19 davanti e 315/30 ZR20 dietro - con battistrada asimmetrico che circonda i dischi freno carboceramici con palette di raffreddamento lavorate e pinze monoblocco a 6 pistoncini ventilati.', '2018-02-08', 1),
('nicolacarl77@gmail.com', 'Porsche Panamera Turbo Sport Turismo, perchÃ© comprarla... e perchÃ© no', 'Parlare di shooting brake anzichÃ© di famigliare non Ã¨ un anglicismo come quelli che oggi vanno tanto di moda. E per accorgersene basta girare velocemente intorno alla carrozzeria: il portellone ad esempio non Ã¨ ampio come quello di una vera famigliare, la â€œboccaâ€ di carico Ã¨ piuttosto rastremata e la soglia dâ€™accesso al baule non invoglia a sollevare da terra oggetti pesanti. La Porsche Panamera Sport Turismo va considerata infatti una famigliare dal piglio sportivo, una shooting brake appunto, anche se i modelli che hanno dato vita a questa categoria (alcune inglesi degli anni â€™60) avevano solo due porte laterali e non quattro. Poco male, visto che questo â€œincrociatoreâ€ tedesco ha una linea esterna molto filante che non tradisce gli ingombri della carrozzeria, generosi ancorchÃ© in linea con la berlina su cui Ã¨ basata: la Sport Turismo Ã¨ lunga 5,05 metri proprio come la Panamera.\r\nPregi e difetti?\r\nLe differenze con la berlina si hanno dietro e nel tetto, allungato per ospitare un portellone che fa ribassare la soglia dâ€™accesso al baule (comunque alta). La Sport Turismo offre in piÃ¹ qualche centimetro per la testa dei passeggeri posteriori e ha un divanetto che allâ€™occorrenza puÃ² ospitare tre persone. Quella al centro in ogni caso resta piuttosto sacrificata. Il bagagliaio non Ã¨ da record, ma carica senza difficoltÃ  un passeggino e una ricca spesa al supermercato. Lâ€™interno ricalca quanto giÃ  visto sulla Panamera ed Ã¨ un trionfo di pelle, materiali curati e tecnologie allâ€™avanguardia, a partire dallâ€™enorme schermo nella consolle (da 12,3\") alle bocchette che si inclinano da sole per indirizzare meglio il getto dâ€™aria. Peccato solo che ci siano pochi vani porta-oggetti. La visibilitÃ  dietro non Ã¨ ottimale, anzi, ma Ã¨ il risvolto della medaglia per avere una linea gradevole nonostante le dimensioni.\r\nQuanto costa?\r\nLa Panamera Sport Turismo parte da 101.500 euro e raggiunge prezzi sui livelli di un bellâ€™appartamento. Basti sapere che la Turbo della nostra prova costa di listino poco piÃ¹ di 164.000 euro, ma con gli accessori tocca i 195.000 euro. Il problema Ã¨ che non bisogna nemmeno â€œimpegnarsiâ€ per raggiungere queste cifre: i dischi freno in materiale composito sono ordinabili a 9.000 euro, per esempio, mentre le sospensioni regolabili elettricamente ne costano altri 2.000 e servono altri 4.300 euro per avere i sedili ventilati e massaggianti davanti e dietro. Stona perÃ² che vadano spesi 2.400 euro per avere un accessorio ormai non piÃ¹ esclusivo come il regolatore di velocitÃ  adattivo con funzione Stop&Go, che avremmo preferito compreso nel prezzo. Chi acquista la Turbo sa giÃ  che deve mettere in preventivo frequenti soste dal benzinaio, considerato che in cittÃ  si percorrono circa 5 km/l.', '2018-02-08', 1),
('nicolacarl77@gmail.com', 'Renault Megane RS, la tutt\'avanti... col posteriore che piace!', 'Anche nel mondo delle auto esistono le fazioni. Câ€™Ã¨ chi apprezza un modello, chi non lo sopporta e ama quello concorrente e chi ancora farebbe qualsiasi cosa per averne uno a dispetto di tutto e tutti. Eâ€™ una questione di tifo, come nello sport. E proprio come nello sport esistono le bandiere, quei modelli simbolici a cui tutti portano rispetto. Uno di questi Ã¨ la Renault Megane RS, la berlina sportiva a cinque porte diventata un riferimento per chi apprezza le â€œbombetteâ€ non troppo impegnative e costose, rinnovata da poco e giunta alla terza generazione.\r\n\r\nComâ€™Ã¨\r\nSfacciata, cattiva e â€œtruzzaâ€ quel tanto che basta. La Megane RS non passa inosservata, a maggior ragione quando si scelgono colori di personalitÃ  come lâ€™arancio Tonic della nostra prova. Anche in grigio, tuttavia, la berlina francese non rischia di essere confusa per una semplice Megane a gasolio: i parafanghi sono allargati di 6 cm davanti e 4,5 cm dietro, lâ€™altezza da terra Ã¨ ribassata di 0,5 cm e al centro del fascione posteriore (piÃ¹ sagomato) fa capolino un vistoso scarico di forma trapezoidale. I cerchi si possono avere anche a 19 pollici (ma compresi nel prezzo ci sono quelli da 18) e sulla carrozzeria non mancano vari riferimenti al mondo delle competizioni, a partire dalle luci diurne a led ispirate ad una bandiera a scacchi fino al labbro anteriore che ricalca quello di una Formula 1. Lo stesso profumo si respira allâ€™interno, dove ci sono la pedaliera in metallo, sedili meglio sagomati e decorazioni sportive su volante, portiere e leva del cambio. In opzione Ã¨ possibile avere il volante ed i sedili rivestiti in Alcantara (300 e 1.000 euro). Gli strumenti nel cruscotto e la grafica del sistema multimediale sono personalizzate. Attraverso lo schermo verticale da 8,4â€ Ã¨ possibile gestire una delle cinque modalitÃ  di guida, da quella piÃ¹ blanda a quella corsaiola: il sistema interviene sulla risposta di sterzo, scarico, cambio, motore e acceleratore.\r\n\r\nCome va\r\nI cambiamenti allâ€™esordio sulla terza generazione sono cosÃ¬ tanti che quasi nessuno si Ã¨ accorto che la Megane RS Ã¨ disponibile solo a cinque porte. Gli amanti della sportivitÃ  a tutti i costi storceranno il naso, ma ciÃ² rende la berlina ancora piÃ¹ sfruttabile e versatile. In particolare scegliendo il cambio automatico EDC a 7 rapporti, che grava sulla bilancia per 30 chili (1.430 chili con i liquidi, 1.407 quella con il manuale a 6 marce) e rende lâ€™auto molto piÃ¹ rilassata nella guida di tutti i giorni. Lâ€™unico difetto del cambio automatico Ã¨ lâ€™ergonomia dei bilancieri per cambiare marcia, non ottimale, ma allâ€™infuori di questo dettaglio lâ€™EDC si Ã¨ rivelato pressochÃ© inappuntabile: lo abbiamo trovato mansueto in automatico e rapido in manuale. Il cambio rispecchia lâ€™indole della Megane RS, che diventa molto affilata e reattiva quando si scelgono le modalitÃ  di guida piÃ¹ estreme. CiÃ² anche per merito del sistema 4Control, che fa girare le ruote posteriori migliorando la stabilitÃ  o la maneggevolezza. Per sfruttarlo appieno bisogna perÃ² abituarsi: basta poco per dare troppo sterzo e sbagliare la traiettoria della curva. La RS diventa ancora piÃ¹ entusiasmante con lâ€™assetto Cup, piÃ¹ estremo, che include un differenziale autobloccante meccanico e consente ai guidatori piÃ¹ smaliziati di togliersi qualche in sfizio in piÃ¹ rispetto alla Megane RS normale (con assetto Sport), facendo rendere al massimo il motore 1.8 turbo da 280 CV.\r\n\r\nCuriositÃ \r\nFra le novitÃ  della nuova Renault Megane RS ci sono i fermi idraulici negli ammortizzatori, messi a punto dalla Renault Sport per evitare che arrivi allâ€™auto lâ€™energia generata passando su una buca profonda: in questo modo le sospensioni sono meglio isolate e non trasferiscono al telaio i contraccolpi della strada, rendendo la Megane piÃ¹ precisa ma anche piÃ¹ confortevole. Questo accorgimento Ã¨ disponibile con il telaio Sport e quello Cup e aveva debuttato con l\'attuale Clio RS.\r\n\r\nQuanto costa\r\nLa berlina francese si puÃ² ordinare da marzo 2018 e verrÃ  consegnata da maggio in poi. Il listino parte da 35.350 euro, ma diventa di 36.950 euro scegliendo il cambio automatico EDC. La Cup invece costa 1.700 euro in piÃ¹ della Megane RS con cambio manuale, pur avendo â€œchiccheâ€ come le sospensioni irrigidite del 10% e il differenziale autobloccante Torsen, che aiuta le ruote anteriori per scaricare a terra la potenza del motore a quattro cilindri. La versione con motore potenziato a 300 CV arriverÃ  entro fine 2018.\r\n\r\nScheda\r\nâ€¢ Motorizzazione provata Renault Megane 1.8 TCe RS 4Control\r\nâ€¢ Quando arriva maggio 2018\r\nâ€¢ Quanto costa 35.350 euro\r\nâ€¢ Quanti CV ha 280\r\nâ€¢ Quanto consuma (ciclo combinato) 6,1 km/l\r\nâ€¢ Quanta CO2 emette 163 g/km\r\nâ€¢ 0-100 km/h 5,8 secondi\r\nâ€¢ Garanzia 2 anni', '2018-02-08', 1),
('nicolacarl77@gmail.com', 'Seat 4Drive, sulla neve tra offroad e traversi', 'SUV e crossover, ormai lo abbiamo capito, sono le auto del momento. Vanno di moda, insomma, cosÃ¬ come va di moda anche la trazione integrale, spesso scelta da guidatori che perÃ² difficilmente lasciano lâ€™asfalto. La veritÃ , perÃ², Ã¨ che 4x4 non Ã¨ sinonimo di fuoristrada ma puÃ² significare anche piÃ¹ sicurezza, piÃ¹ divertimento e, in generale, la tranquillitÃ  di poter affrontare qualsiasi condizione climatica quando si viaggia con la propria auto. Per capirlo meglio abbiamo provato la gamma 4Drive di Seat ma questa volta lontani dallâ€™assolata Spagna.\r\n\r\nLeon ST X-Perience, avventuriera giÃ  nel nome\r\nLa neve austriaca sulle montagne a pochi km da Inssbruck Ã¨ stato il terreno perfetto su cui mettere alla prova, in condizioni dure ma non estreme, la trazione intelligente che equipaggia la Seat Leon ST Cupra, la Ateca e la Leon X-Perience. Proprio questâ€™ultima ha dimostrato tutto il suo carattere di wagon avventuriera nelle ripartenze su una salita innevata: il sistema di Auto Hold la tiene ancorata al suolo e poi il 4Drive ripartisce la trazione, che di norma Ã¨ sulle ruote anteriori, anche allâ€™assale posteriore quando sente che il grip viene a mancare. E per vedere in azione questa intelligenza artificiale le X-Perience hanno affrontato una prova tipica del fuoristrada, il twist, nel quale anche lâ€™altezza maggiorata di 15mm rispetto alla versione â€œnormaleâ€ gioca un ruolo importante.\r\n\r\nAteca, intelligenza che legge il fondo stradale\r\nDici 4x4 e pensi ad un SUV, e infatti non poteva mancare un giro in fuoristrada con la prima â€œrialzataâ€ della Casa spagnola, la Ateca. Anche qui il sistema 4Drive, che si basa su una frizione multidisco ad azionamento idraulico e controllo elettronico, Ã¨ in grado di capire quando avviene lo slittamento e, oltre a poter mandare tutta la potenza alle ruote dietro, puÃ² anche variare la distribuzione di coppia sullo stesso asse pur non essendoci un differenziale autobloccante meccanico: avviene tutto tramite lâ€™EDS che blocca la ruota che gira a vuoto e tutto senza quasi che il conducente se ne accorga. Un modo, insomma, per gestire ogni singolo appoggio a terra su strade che, per loro natura, sono irregolari e continuamente diverse, proprio come un percorso di neve non battuta.\r\n\r\nLeon ST Cupra, asfalto o neve Ã¨ sempre lei\r\nOk, abbiamo visto che queste spagnole sulla neve se la cavano e anche discretamente, ma come si fa a resistere ad un poâ€™ di sano drifting sul ghiaccio? E per farlo non unâ€™auto a caso ma, ovviamente, la Leon ST Cupra da 300 CV e 380 Nm che, oltre alla trazione integrale, Ã¨ equipaggiata anche con il sempre rapidissimo cambio DSG. ModalitÃ  CUPRA inserita, controlli elettronici disabilitati, gomme chiodate e allora ecco che comincia la danza: un divertimento di altissimo livello, grazie allâ€™ottimo feeling di sterzo e pedale del gas, in tutta sicurezza. PerchÃ© il 4x4 non Ã¨ solo â€œoffroadâ€, ma agilitÃ  in curva e risposte piÃ¹ veloci, sempre a patto comunque di calzare le gomme giuste. PerchÃ©, Ã¨ importante ricordarlo, gli pneumatici sono lâ€™unico punto di contatto dellâ€™auto con il terreno e in linea di massima Ã¨ preferibile avere unâ€™auto â€œtradizionaleâ€, cioÃ¨ a trazione anteriore, con le invernali piuttosto che unâ€™integrale con le gomme estive.', '2018-02-08', 1);
